import React, { Component} from 'react';
import tasks from '../sample/tasks.json';




export default class Task extends Component{

    state={
        tasks: tasks
    }

    render(){
        return (

            <div>
                {this.state.tasks.map( task => <h1>{task.descripcion}</h1>)}
                 <p>{this.state.descripcion}</p>
            </div>
        )}

}
